sequence = ""

#####################################
#									#
#				PART 1				#
#									#
#####################################

import collections

marker = collections.deque(maxlen=4)
charPos = 0

for char in sequence:
	if charPos <= 4:
		marker.append(char)
	else:
		dups = set(marker)
		if len(dups) == len(marker):
			break
		else:
		    marker.append(char)
	charPos += 1

print(charPos)

